import { useEffect, useState } from 'react';
import { getUsers } from '../../../APIs/userApi';

const UsersTable = () => {
  const [users, setUsers] = useState([]);

  useEffect(async () => {
    setUsers(await getUsers())
    console.log(users)
  }, []);

}

export default UsersTable;
